class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        one_count = 0
        max_one_count = 0
        for num in nums:
            if num == 0:
                one_count = 0
            else:
                one_count += 1
                max_one_count = max(max_one_count, one_count)

        return max_one_count

